import React from 'react';
import ReactDOM from 'react-dom';
import { createRoot } from 'react-dom/cjs/react-dom.production.min';
import App from './App';
import './App.css';

createRoot.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
